You may have noticed that our grammar included two distinct kinds of symbols. There were the nonterminals, Term and Num, which we defined by specifying a series of symbols that they must match, along with some action code that should execute once they have matched: Num: i32 = r"[0-9]+" => i32::from_str(<>).unwrap();
// ~~~ ~~~ ~~~~~~~~~ ~~~~~~~~~~~~~~~~~~~~~~~~~~
// | | | Action code
// | | Symbol(s) that should match
// | Return type
// Name of nonterminal But there are also terminals , which consist of the string literals and regular expressions sprinkled throughout the grammar. (Terminals are also often called tokens , and I will use the terms interchangeably.) This distinction between terminals and nonterminals is very important to how LALRPOP works. In fact, when LALRPOP generates a parser, it always works in a two-phase process. The first phase is called the lexer or tokenizer . It has the job of figuring out the sequence of terminals : so basically it analyzes the raw characters of your text and breaks them into a series of terminals. It does this without having any idea about your grammar or where you are in your grammar. Next, the parser proper is a bit of code that looks at this stream of tokens and figures out which nonterminals apply: +-------------------+ +---------------------+
Text -> | Lexer | -> | Parser | | | | | | Applies regex to | | Consumes terminals, | | produce terminals | | executes your code | +-------------------+ | as it recognizes | | nonterminals | +---------------------+ LALRPOP's default lexer is based on regular expressions. By default, it works by extracting all the terminals (e.g., "(" or r"\d+") from your grammar and compiling them into one big list. At runtime, it will walk over the string and, at each point, find the longest match from the literals and regular expressions in your grammar and produces one of those. As an example, let's look again at our example grammar: pub Term: i32 = { <n:Num> => n, "(" <t:Term> ")" => t,
}; Num: i32 = <s:r"[0-9]+"> => i32::from_str(s).unwrap(); This grammar in fact contains three terminals: "(" -- a string literal, which must match exactly ")" -- a string literal, which must match exactly r"[0-9]+" -- a regular expression When we generate a lexer, it is effectively going to be checking for each of these three terminals in a loop, sort of like this pseudocode: let mut i = 0; // index into string
loop { skip whitespace; // we do this implicitly, at least by default if (data at index i is "(") { produce "("; } else if (data at index i is ")") { produce ")"; } else if (data at index i matches regex "[0-9]+") { produce r"[0-9]+"; }
} Note that this has nothing to do with your grammar. For example, the tokenizer would happily tokenize a string like this one, which doesn't fit our grammar: ( 22 44 ) ) ^ ^^ ^^ ^ ^ | | | | ")" terminal | | | | | | | ")" terminal | +----+ | | | 2 r"[0-9]+" terminals | "(" terminal When these tokens are fed into the parser , it would notice that we have one left paren but then two numbers (r"[0-9]+" terminals), and hence report an error.

