Terminals in LALRPOP can be specified (by default) in two ways. As a fixed string (like "(") or a regular expression (like r[0-9]+). There is actually an important difference: if, at some point in the input, both a fixed string and a regular expression could match, LALRPOP gives the fixed string precedence. To demonstrate this, let's modify our parser. If you recall, the current parser parses parenthesized numbers, producing a i32. We're going to modify if to produce a string , and we'll add an "easter egg" so that 22 (or (22), ((22)), etc) produces the string "Twenty-two": pub Term = { Num, "(" <Term> ")", "22" => "Twenty-two!".to_string(),
}; Num: String = r"[0-9]+" => <>.to_string(); If we write some simple unit tests, we can see that in fact an input of 22 has matched the string literal. Interestingly, the input 222 matches the regular expression instead; this is because LALRPOP prefers to find the longest match first. After that, if there are two matches of equal length, it prefers the fixed string: #[test]
fn calculator2b() { let result = calculator2b::TermParser::new().parse("33").unwrap(); assert_eq!(result, "33"); let result = calculator2b::TermParser::new().parse("(22)").unwrap(); assert_eq!(result, "Twenty-two!"); let result = calculator2b::TermParser::new().parse("(222)").unwrap(); assert_eq!(result, "222");
}

