A match declaration lets you explicitly give the precedence between terminals. In its simplest form, it consists of just ordering regular expressions and string literals into groups, with the higher precedence items coming first. So, for example, we could resolve our conflict above by giving r"[0-9]+" precedence over r"\w+", thus saying that if something can be lexed as a number, we'll do that, and otherwise consider it to be an identifier. match { r"[0-9]+"
} else { r"\w+", _
} Here the match contains two levels; each level can have more than one item in it. The top-level contains only r"[0-9]+", which means that this regular expression is given highest priority. The next level contains r\w+, so that will match afterwards. The final _ indicates that other string literals and regular expressions that appear elsewhere in the grammar (e.g., "(" or "22") should be added into that final level of precedence (without an _, it is illegal to use a terminal that does not appear in the match declaration). If we add this match section into our example, we'll find that it compiles, but it doesn't work exactly like we wanted. Let's update our unit test a bit to include some identifier examples:: #[test]
fn calculator2b() { // These will all work: let result = calculator2b::TermParser::new().parse("33").unwrap(); assert_eq!(result, "33"); let result = calculator2b::TermParser::new().parse("foo33").unwrap(); assert_eq!(result, "Id(foo33)"); let result = calculator2b::TermParser::new().parse("(foo33)").unwrap(); assert_eq!(result, "Id(foo33)"); // This one will fail: let result = calculator2b::TermParser::new().parse("(22)").unwrap(); assert_eq!(result, "Twenty-two!");
} The problem comes about when we parse 22. Before, the fixed string 22 got precedence, but with the new match declaration, we've explicitly stated that the regular expression r"[0-9]+" has full precedence. Since the 22 is not listed explicitly, it gets added at the last level, where the _ appears. We can fix this by adjusting our match to mention 22 explicitly: match { r"[0-9]+", "22"
} else { r"\w+", _
} This raises the interesting question of what the precedence is within a match rung -- after all, both the regex and "22" can match the same string. The answer is that within a match rung, fixed literals get precedence over regular expressions, just as before, and all regular expressions must not overlap. With this new match declaration, we will find that our tests all pass.

