Let us revisit the original rule in the grammar for string literals, from our first version: pub Lit: Lit = "\"" <r"[a-z]*"> "\"" => <>.into(); The heart of our problem is that we have implicitly specified distinct tokens for the string delimiter ("\"") versus the string content (in this case, r"[a-z]*"). Intuitively, we only want to tokenize string content when we are in the process of reading a string. In other words, we only want to apply the r"[a-z]*" rule immediately after reading a "\"". But the generated lexer does not infer this from our rules; it just blindly looks for something matching the string content regular expression anywhere in the input. You could solve this with a custom lexer (treated in the next section). But a simpler solution is to read the string delimiters and the string content as a single token , like so: pub Var: Var = <r"[a-z]"> => <>.chars().next().unwrap().into(); pub Lit: Lit = <l:r#""[a-z ]*""#> => l[1..l.len()-1].into(); pub Eql: Eql = <Var> "=" <Lit> => (<>).into(); (Note that this form of the grammar does not require any match statement; there is no longer any ambiguity between the different regular expressions that drive the tokenizer.) With this definition of the grammar, all of these tests pass: #[test]
